import { useState } from 'react';
import styled from 'styled-components';
import logo from '../../Assets/Images/logo-black.png'
import SideBar from './SideBar';

const Container = styled.div`
        width: 100vw;
        height: 64px;
        opacity: ;
      `;

const Contents = styled.div`
        width : 100%;
        height: 90%;
        margin: auto;
        display: flex;
        justify-content : space-between;
        align-items: center;
      `;

const Hamburgur = styled.div`
      `

const Logo = styled.div`
        background: url(${logo});
        height:31px;
        background-size: cover;
        width : 57px;
        margin : auto;
      `

const Nav: React.FC = () => {

  const [sideMenu, setSideMenu] = useState<boolean>(true);

  const showSideMenu = (): void => {
    setSideMenu(!sideMenu);
    console.log(sideMenu)
  };

  const hideSideMenu = (): void => {
    setSideMenu(false);
  };


  return (
    <Container>
      <Contents>
        <Hamburgur onClick={showSideMenu}>
          <svg width="64" height="64" viewBox="0 0 64 64" fill="none" xmlns="http://www.w3.org/2000/svg">
            <rect width="64" height="64" fill="white" />
            <line x1="19" y1="20.5" x2="44" y2="20.5" stroke="#5C5649" />
            <line x1="19" y1="31.5" x2="44" y2="31.5" stroke="#5C5649" />
            <line x1="19" y1="42.5" x2="44" y2="42.5" stroke="#5C5649" />
          </svg>
        </Hamburgur>
        <Logo></Logo>
        <div>
        <svg width="64" height="64" viewBox="0 0 64 64" fill="none" xmlns="http://www.w3.org/2000/svg">
            <rect width="64" height="64" fill="white" />
            <line x1="19" y1="20.5" x2="44" y2="20.5" stroke="#5C5649" />
            <line x1="19" y1="31.5" x2="44" y2="31.5" stroke="#5C5649" />
            <line x1="19" y1="42.5" x2="44" y2="42.5" stroke="#5C5649" />
          </svg>
        </div>
      </Contents>
      <SideBar sideMenu={sideMenu} hideSideMenu={hideSideMenu}/>
    </Container>
  );
}

export default Nav;
